import React, { Component } from 'react'
import planetsData from '../src/data/planets.js'

const rotation_period = planetsData.planets[0].rotation_period



class Constellations extends Component {
    render() {
        return (
            <div>
                <h1>Constellations</h1>
                <h1>{rotation_period.length}Planets</h1>
            </div>

        )

    }



}

export default Constellations
